import React from "react";
interface InputProps {
  type?: string;
  placeholder?: string;
}

const Input: React.FC<InputProps> = ({ type, placeholder }) => {
  return (
    <input
      className="p-3 w-3/4 my-6 focus:outline-none focus:border-blue-500 border-2 rounded-xl"
      type={type}
      placeholder={placeholder}
    ></input>
  );
};

export default Input;
